css:
@-moz-document domain("www.nitrotype.com")
{
.raceResults-rewards {
   background: #3b3d4c url("https://media0.giphy.com/media/BemKqR9RDK4V2/giphy.gif") left top repeat;
   color: #fff;
   border-radius: 5px;
   padding: 15px;
   position: relative;
   height: 75%;
}

.raceResults--default {
    background: url(https://thumbs.gfycat.com/UnevenBlankDragon-size_restricted.gif) top right repeat, linear-gradient(to bottom, #20222e 80%, #020202 101%);
    color: #fff;
    display: flex;
    flex-direction: column;
    box-shadow: 0 28px 28px 0 rgba(2, 2, 2, 0.05), 0 17px 17px 0 rgba(2, 2, 2, 0.2), 0 8px 8px 0 rgba(2, 2, 2, 0.15);
    border: 2px solid #3b3d4c;
}
}
